def PostPic1(pic_list):
    tmp=str(time.time())
    headers = {
        "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36",
    }
    url = "http://192.168.5.181:10121/geetest4_word/gradio_api/queue/"
    # url = "http://192.168.5.181:10121/geetest4_icon/gradio_api/queue/"
    # url = "http://127.0.0.1:1012/geetest4_icon/gradio_api/queue/"
    params = {
        "": ""
    }
    data = {
        "data":pic_list,
        "fn_index": 1,
        "session_hash":tmp
    }
    data = json.dumps(data, separators=(',', ':'))
    requests.post(url+"join", headers=headers, params=params, data=data, verify=False)
    params = {
        "session_hash": tmp
    }
    response = requests.get(url+"data", headers=headers, params=params, verify=False)
    message_count = 0  # 初始化计数器
    # 逐行读取事件流数据
    for line in response.iter_lines(decode_unicode=True):
        if line:  # 跳过空行
            if line.startswith("data:"):
                data = line[5:].strip()  # 去掉 "data:" 前缀并清理空格
                message_count += 1
                # 检查是否已接收到第三条消息
                if message_count == 3:
                    xy=[]
                    plan=json.loads(data)["output"]["data"][1]
                    for crop in plan:
                        x1, y1, x2, y2 = crop
                        xy.append([(x1 + x2) / 2, (y1 + y2) / 2])
                    return xy


