def rev_msg(tmp):
    def get_third_event_result(url):
        headers = {
            "User-Agent": "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/129.0.0.0 Safari/537.36"
        }
        params = {
            "session_hash": tmp
        }
        response = requests.get(url, headers=headers, params=params, verify=False)

        # 检查响应状态码
        if response.status_code != 200:
            raise Exception(f"Failed to connect, status code: {response.status_code}")

        message_count = 0  # 初始化计数器

        # 逐行读取事件流数据
        for line in response.iter_lines(decode_unicode=True):
            if line:  # 跳过空行
                if line.startswith("data:"):
                    data = line[5:].strip()  # 去掉 "data:" 前缀并清理空格
                    message_count += 1

                    # 检查是否已接收到第三条消息
                    if message_count == 3:
                        return data  # 返回第三条消息内容

        # 若未接收到足够的消息条数，返回 None 或抛出异常
        return None

    # 示例用法
    url = "http://192.168.5.181:10121/geetest4_word/gradio_api/queue/data"
    try:
        third_message = get_third_event_result(url)
        if third_message:
            print(third_message)
        else:
            print("Less than three messages received.")
    except Exception as e:
        print("Error:", e)

